B.LL=new A.hF("My name is Rylan Reaper. I come from a small Texas farming town called Dawson, graduating high school as Valedictorian of my class. I was typically kept busy, participating in a myriad of activities like: Football, Baseball, Track, Powerlifting, FFA, Debate, One Act Play, among many other academic events for UIL. Elaborating more on FFA, as it was the organization which I contributed much of my time, I raised show animals like goats, shared the scientific wonder of hydroponics through competitive Public Speaking, even acting as Vice President of the District, traveling across Texas during the summer to organize and lead FFA youth camps. After graduating college, I went to Texas A&M University to study Computer Science, learning hard and fast how technologically ignorant I was at the time, never expecting that I would one day be able to independently contribute to projects on a national, industry scale. I also got the privilage to join the Texas A&M Paranormal Society (TAPS) during only its second semester of operation, getting to act as its Comm/Tech Manager and even its Vice President over my years at A&M, making many friends and heartpumping memories along the way. I share all of this because I consider myself a person of wide, varied experience, a Jack of all trades, hardworking and open-minded, always ready to adapt for what life throws next.",null,B.L8,B.de,null)
B.LM=new A.hF("I first learned about the computer software known as Blender when I was in high school, around 2015, likely around the time the popular web series RWBY was growing in popularity on YouTube. Up to that point, I had only really been exposed to 2D hand-drawn animation, and for some reason, the idea of crafting characters and objects in 3D space to model, pose, and animate, seemed to work better for my brain. Now, I also enjoy 2D art. 3D art just seems to make more sense to me. Unfortunately, while in college, I didn't really have the time to learn Blender, being an almost comically unfriendly software to start. Finally, in 2022, fresh out of college, I got my first 3D printer, a classic Creality Ender 3 V2, I installed Blender, and I didn't stop. Now, I am printing full-sized fantasy swords from anime and games,meticulously measuring and prototyping to create custom deckboxes for my favorite trading card games, as well as, sculpting characters for more intricate designs. I hope to keep taking this craft even farther, creating more detailed models, possibly with more moving parts and function. I even hope to, with more practice and familiarity, follow my inspirations and start making animations and games.",null,B.eH,B.de,null)
